import { Layout, Menu } from "antd";
import React from "react";
import {DownOutlined} from "@ant-design/icons"
const LayoutHeader = () => {
  const { Header, Content, Footer } = Layout;


  const languageOptions = ["AR", "FR", "EN", "ES", "DE", "HE", "ID", "ZH-TW", "PT", "TH", "DA", "JA", "KO"];
  return (
    <div className="nav">
      <div className="nav-wrapper">
        <div className="flex align-items-center left">
          <a href="#">
            <img
              alt="logo"
              src="https://www.luminskin.com/_next/static/images/logo-20c2cb1d9d2bb6d2139d0e5cec3103bd.png"
              className="logo"
            />
          </a>
          <a className="flex-1">Shop</a>
          <a className="flex-1">About</a>
          <a className="flex-1">Support</a>
          <a className="flex-1">Blog</a>
        </div>

        <div className="d-flex right">
          <a className="flex-1">Account</a>
          <div className="flex">
            <img
              src="data:image/png;base64,"
              className="cart-icon"
              alt="cart icon"
            />
           <p className="cart-counter">0</p>
          </div>

        <div className="select-wrapper">
            <select className="select-style">
              {languageOptions.map((language, index)=>
                <option key={index} value={language}>{language}</option>
              )}

            </select>
            <div className="select-dropdown">
            <DownOutlined />
            </div>
          </div>
        </div>
      </div>
    </div>
